let p384_montjadd_unopt_dead_value_info =
  let _,_,n,_,_ = last !actions1 in Array.init n (fun _ -> []);;

let i = ref 0;;
List.iter (fun code_block ->
  match code_block with
  | "equal", Some instcnt ->
    (* simply, don't add any data. *)
    i := instcnt + !i
  | callstr, None -> begin
    match callstr with
    | "call montmul_p384" ->
      i := 4 + !i; (* arguments + bl *)
      i := 4 + !i; (* callee-save reg stores *)
      for j = 0 to Array.length local_montmul_p384_dead_value_info - 1 do
        p384_montjadd_unopt_dead_value_info.(!i) <-
          local_montmul_p384_dead_value_info.(j);
        i := 1 + !i;
      done;
      i := 5 + !i (* callee-save restores and ret *)
    | "call montsqr_p384" ->
      i := 3 + !i; (* arguments + bl *)
      for j = 0 to Array.length local_montsqr_p384_dead_value_info - 1 do
        p384_montjadd_unopt_dead_value_info.(!i) <-
          local_montsqr_p384_dead_value_info.(j);
        i := 1 + !i;
      done;
      i := 1 + !i (* ret *)
    | "call sub_p384" ->
      i := 4 + !i; (* arguments + bl *)
      for j = 0 to Array.length local_sub_p384_dead_value_info - 1 do
        p384_montjadd_unopt_dead_value_info.(!i) <-
          local_sub_p384_dead_value_info.(j);
        i := 1 + !i;
      done;
      i := 1 + !i (* ret *)
  end)
  code_blocks;;

assert (!i = Array.length p384_montjadd_unopt_dead_value_info);;

